import React from 'react';
import './Card.css'

const card = (props) => {
  return (
    <div className="Card">
  <h1>I'm {props.name} and I am {props.age}.</h1>
  <p>{props.children}</p>
  <input type="text" onChange={props.changed} value={props.name}/>
  </div>
)
}



export default card;
